import React from 'react'
import PropTypes from 'prop-types'

import './Keyboard.css'

const HIDDEN_SYMBOL = '❓'

const Keyboard = ({ alphabet }) => {
    return(
        <div>
            {
                alphabet.map(
                  (letter, key) => {
                        return <button key={ "letter_"+ key }>{letter} </button>
                  }
                )
            }
        </div>
    )
}

export default Keyboard
